let counter = 0;

const sendRequest = (id: string, i: number) => {
    const req = request(options, (res) => {
        const chunks: any = [];

        res.on('data', (chunk) => {
            chunks.push(chunk);
        });

        res.on('end', () => {
            const responseBody = Buffer.concat(chunks);
            if (responseBody.toString().match(/error/)) {
                console.log(responseBody.toString());
            } else {
                counter++;
            }
            sendRequest(id, i + 1);
        });
    });

    req.write(body);
    req.end();
};

const printCounter = () => {
    console.log(`${counter} REQUESTS PER MINUTE`);
    counter = 0;
    setTimeout(printCounter, 60000);
};

